import React from "react";
import {RouterLink, Route, Router } from 'react-router-dom';
import Typography from "@mui/material/Typography";
import MenuItem from "@mui/material/MenuItem";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import logo from "../images/EZR_Blue.png";
import Login from "./Login.js";

const pages = ["How it works", "Pricing", "FAQs", "Contact Us", "About"];

function Header (){
    const [anchorElNav, setAnchorElNav] = React.useState(null);
  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };
    return(
<Box
        sx={{
          backgroundColor: "white",
          display: { xs: "flex" },
          justifyContent: "space-between",
          alignItems: "center",
          padding:1

        }}
      >
        <img src={logo} className="App-logo" alt="logo" />
        {pages.map((page) => (
          <MenuItem key={page} onClick={handleCloseNavMenu}>
            <Typography color="#0698d2" textAlign="center" fontSize="20px">
              {page}
            </Typography>
          </MenuItem>
        ))}
        <Router>
        <Button component ={RouterLink} to="/login" sx={{ backgroundColor: "#0698d2" , borderRadius: "10px" }}>


              <Route path="/login" element={<Login/>}>

              </Route>  


        </Button>
        </Router>
      </Box>
    );
}

export default Header;
